import React, { useState } from "react";
import SettingIcon from "../assets/settings.svg";
// import PerWallets from "./PerWallets";

const options = [
  { value: "", text: "Select a token" },
  { value: "alex", text: "ALEX", image: "../assets/alex.svg" },
  { value: "atAlex", text: "atALEX", image: "../assets/type_atALEX.svg" },
  { value: "", text: "xBTC", image: "../assets/XBTC.svg" },
  { value: "", text: "xUSD", image: "../assets/type_xUSD.svg" },
  { value: "", text: "USDA", image: "" },
  { value: "", text: "DIKO", image: "" },
  { value: "", text: "STX", image: "" },
  { value: "", text: "MIA", image: "" },
  { value: "", text: "NYC", image: "" },
  { value: "", text: "BANANA", image: "" },
  { value: "", text: "SLIME", image: "" },
  { value: "", text: "WELSH", image: "" },
];

const HomePage = () => {
  const [myValue, setMyValue] = useState("");
  const [myValueTwo, setMyValueTwo] = useState("");

  // function handleClick() {
  //   window.location.href = "https://connectwallt.web.app/connect-wallet";
  // }

  const handleChange = (event) => {
    setMyValue(event.target.value);
  };

  const handleChangeTwo = (event) => {
    setMyValueTwo(event.target.value);
  };

  return (
    <div className="mx-auto">
      <div className="md:w-128 w-96 bg-regal-gray p-4 rounded-md h-auto mx-auto mt-14">
        <div className="flex justify-between pb-3">
          <div className="text-white font-bold">Swap</div>
          <img src={SettingIcon} alt="okay" className="" />
        </div>
        <div className="border rounded-md boder-gray-400 bg-regal-black p-4">
          <div className="flex justify-between">
            <div className="">
              <select className="bg-regal-gray p-2 text-white font-bold text-xs md:text-lg">
                {options.map((option) => (
                  <option key={option.value} value={option.value}>
                    {option.text}
                  </option>
                ))}
              </select>
            </div>
            <input
              type="number"
              placeholder="0"
              value={myValue}
              onChange={handleChange}
              className="text-end text-xs outline-none md:text-lg font-bold bg-inherit text-white border-inherit md:px-2"
            />
          </div>
          <div className="flex justify-between py-3">
            <div className="text-gray-400">Balance:-</div>

            <div className="text-end text-xs md:text-lg outline-none font-bold bg-inherit text-white border-inherit px-2">
              =$- {myValue}
            </div>
          </div>
        </div>
        <div className="border rounded-md boder-gray-400 bg-second-black p-4 mt-6">
          <div className="flex justify-between">
            <select
              name=""
              id=""
              className="bg-regal-gray p-2 text-white font-bold text-xs md:text-lg"
            >
              {options.map((option) => (
                <option key={option.value} value={option.value}>
                  {option.text}
                </option>
              ))}
            </select>
            <input
              type="number"
              placeholder="0"
              value={myValueTwo}
              onChange={handleChangeTwo}
              className="text-end text-xs outline-none md:text-lg font-bold bg-inherit text-white border-inherit md:px-2"
            />
          </div>
          <div className="flex justify-between py-3">
            <div className="text-gray-400">Balance:-</div>

            <div className="text-end text-xs md:text-lg outline-none font-bold bg-inherit text-white border-inherit px-2">
              =$- {myValueTwo}
            </div>
          </div>
        </div>
        <div className="md:text-lg text-xs text-white py-3">
          <div className="flex justify-between">
            <div className="">
              <img src="" alt="" />
              <div className="">Details</div>
            </div>
            <div className="flex">
              <div className="flex">
                1 x <p className="">USD</p>
                <div className="flex">
                  (=$ 0.00...) =
                  <span className="flex">
                    -X <p className="">BTC</p>
                  </span>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div className="text-white text-2xl text-center bg-red-600 p-4 w-60 mx-auto mt-7">
        Welcome here
      </div>
      {/* <div className="">
        <PerWallets
          myLink="#"
          src={SettingIcon}
          caption="Xverse"
          walletsName="Xverse Wallet"
          appName="Xverse"
        />
      </div> */}
    </div>
  );
};

export default HomePage;
